We can use the CYK algorithm.  First, note which non‐terminals produce each single terminal in our string “t19 t32 t9 t32 t14 t4”:

position 1 “t19” ⇒ {NT3}  
position 2 “t32” ⇒ {NT4}  
position 3 “t9”  ⇒ {NT0}  
position 4 “t32” ⇒ {NT4}  
position 5 “t14” ⇒ {NT7}  
position 6 “t4”  ⇒ {NT2, NT7}  

Now build up substrings of length 2:

– (1–2): {NT3} × {NT4} ⇒ no rule X→NT3 NT4 so ∅  
– (2–3): {NT4} × {NT0} ⇒ NT3→NT4 NT0 so {NT3}  
– (3–4): {NT0} × {NT4} ⇒ ∅  
– (4–5): {NT4} × {NT7} ⇒ S→NT4 NT7 so {S}  
– (5–6): {NT7} × {NT2,NT7} ⇒ no matching rules so ∅  

No other non‐terminals appear for length 2.  For length 3 and above every split involves at least one empty cell, so all longer substrings remain un‐derivable.  In particular the full 6‐long span (1–6) never acquires S.  Hence the grammar does not generate the string.

