After examining the connectivity of the nonterminals, one sees that

  1) every terminal (t14, t19, t32, t9, t24, t4, t26, t28, t15) appears as a right‐hand side of some NT→terminal rule;  
  2) the binary productions form one huge strongly‐connected component over {NT0,…,NT9};  
  3) S can reach into that component via several S→NTi NTj rules.

In consequence S can “walk” through the component to generate arbitrarily long strings, inserting any of the nine terminals in any order. Our given 25‐symbol string uses only those terminals, so it lies in L(G).  

